import React from "react";
import {ProductConsumer} from '../context'
export default function Product() {
  return (
    <div className="cn">
      <h1 className='title'>Our products</h1>
   <div className='row'>
     <ProductConsumer>
  {value => <h1>{value}</h1>} 
     </ProductConsumer>
   </div>
    </div>
  );
}
